package velocity_project;

public class star3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//outer loop=no of line
		for(int b=1;b<=15;b++)//3
		{
			//inner loop=no of start/line
			for(int a=0;a<15;a++)//5
			{
				System.out.print("*");
			}
			System.out.println();
		}
	}

}
